export default function Header() {
    return (
        <div id="" align="left">
            <div>
                <div style={{
                    float: "left"
                }}>My Shopping List</div>
                <div style={{
                    float: "left"
                }}>
                    <a href="/">
                        MyPage
                    </a>
                </div>
            </div>
        </div>
    );
}
